children.value:
switch (type) {
  case 'Object':
    id = _.util.objId(o);
    if (visited[id]) {
      return visited[id];
    }
    clone = {};
    visited[id] = clone;

    for (var key in o) {
      if (o.hasOwnProperty(key)) {
        clone[key] = deepClone(o[key], visited);
      }
    }
    return clone;

  default:
    return o;
}
